function LoadJs() {
    const scriptUrls = [
        '../Services/js/jquery.min.js',
        '../Services/js/jquery.poptrox.min.js',
        '../Services/js/browser.min.js',
        '../Services/js/breakpoints.min.js',
        '../Services/js/util.js',
        '../Services/js/main.js'
      ];

    scriptUrls.forEach(url => {
        const script = document.createElement('script');
        script.src = url;
        script.async = true;
        document.body.appendChild(script);
    });
}

export default LoadJs;
